import { Button } from 'reactstrap'
import Layout from '../components/layout'
import Particles from 'react-particles-js'
import Menu from '../components/menu'

const particleOpt = {
  particles: {
    number: {
      value: 150,
      density: {
        enable: true,
        value_area: 800
      },
      move: {
        enable: true,
        speed: 1
      }
    }
  },
  interactivity: {
    events: {
        onhover: {
            enable: true,
            mode: ["push"]
        }
    }
  }
}

function Index(props) {
    return (
      <div>
        <header>
          <Menu className="menuTop" />
        </header>
        <Particles canvasClassName="particle-canvas" params={particleOpt} />
        <Layout>
          <div className="wrapper">
            <div className="introduction">
              <h1 className="display-3 text-center hello">Hello, I'm <span>Maicon Esteves</span>.</h1>
              <h2 className="display-3 text-center hello">I'm a full-stack developer.</h2>
              <p className="lead center">
                <Button color="btn btn-lg primary">Learn More</Button>
              </p>
            </div>
          </div>
        </Layout>



      </div>
    );
}

export default Index
